
    /**
     * Bitwise circular shift left
     * http://en.wikipedia.org/wiki/Circular_shift
     */
    /**
     * Description
     * @method rol
     * @param {} val
     * @param {} shift
     * @return BinaryExpression
     */
    function rol(val, shift){
        return (val << shift) | (val >> (32 - shift));
    }
    module.exports = rol;

